import React, { useState, useEffect } from 'react';
import axios from 'axios';

const Home = () => {
    const [planets, setPlanets] = useState([]);
    const [searchTerm, setSearchTerm] = useState('');

    useEffect(() => {
        fetchPlanets();
    }, []);

    const fetchPlanets = async () => {
        try {
            const response = await axios.get('http://localhost:4000/api/planets');
            setPlanets(response.data);
        } catch (error) {
            console.error('Error fetching planets:', error);
        }
    };

    const handleSearch = async () => {
        try {
            const response = await axios.get(`http://localhost:4000/api/planets/search?keyword=${searchTerm}`);
            setPlanets(response.data);
        } catch (error) {
            console.error('Error searching for planets:', error);
        }
    };

    return (
      <div>
        <div style={{ display: 'flex', flexDirection: 'column', alignItems: 'center', justifyContent: 'center' }}>
        <h1>Planets Catalog</h1>
        <div>
          <input
            type="text"
            placeholder="Search"
            value={searchTerm}
            onChange={(e) => setSearchTerm(e.target.value)}
          />
          <button onClick={handleSearch}>Search</button>
        </div>
      </div>
        <div style={{ display: "flex", flexWrap: "wrap", justifyContent: "center" }}>
          {planets.map((planet, index) => (
            <div key={index} className="row-container" style={{ display: 'flex', alignItems: 'flex-start' }}>
              <div className="card mb-3 mx-3" style={{ width: '265px', display: 'flex', flexDirection: 'column' }}>
                <div className="card-body" style={{ minHeight: '100px', flexGrow: '1', display: 'flex', flexDirection: 'column' }}>
                  <h6 className="card-title" style={{ fontSize: '1.5rem', fontWeight: 'bold', marginBottom: '10px', textAlign: 'center'  }}>{planet.name}</h6>
                  <p><strong>Climate:</strong> {planet.climate}</p>
                  <p><strong>Terrain:</strong> {planet.terrain}</p>
                  <p><strong>Population:</strong> {planet.population}</p>
                  {/* Optionally, add more details or actions */}
                </div>
              </div>
            </div>
          ))}
        </div>
      </div>
    );


};

export default Home;
